import React from "react";
import "./BlogCard.css";

function BlogCard(props) {
    return (
        <div className="blog-card-container">
          <div className="blog-post__likes">{props.likes} likes</div>
          <div className="blog-post__title">{props.title}</div>
          <div className="blog-post__author">Posted by {props.author}</div>
          <div className="blog-post__content">{props.content}</div>
        </div>
    );
}

export default BlogCard;
